import DashboardPageLayout from "../pages/DashboardPageLayout";
import HomePage from "../pages/HomePage";
import { RouteType } from "./config";
import ArduinoPage from "../pages/ArduinoPage";
import RoboticsPage from "../pages/RoboticsPage";
import SolidWorksPage from "../pages/SolidWorksPage";
import AutoCadPage from "../pages/AutoCadPage";
import DashboardOutlinedIcon from '@mui/icons-material/DashboardOutlined';

const appRoutes: RouteType[] = [
  {
    index: true,
    element: <HomePage />,
    state: "home"
  },

  {
    path: "/electrical-and-electronics-engineering",
    element: <DashboardPageLayout />,
    state: "electrical-and-electronics-engineering",
    sidebarProps: {
      displayText: "Electrical and Electronics Engineering",
      icon: <DashboardOutlinedIcon />
    },
    child: [
      {
        path: "/electrical-and-electronics-engineering/arduino",
        element: <ArduinoPage />,
        state: "arduino",
        sidebarProps: {
          displayText: "Arduino"
        },
      },
      {
        path: "/electrical-and-electronics-engineering/robotics",
        element: <RoboticsPage />,
        state: "robotics",
        sidebarProps: {
          displayText: "Robotics"
        },
      }
    ]
  },
  {
    path: "/mechanical-engineering",
    element: <DashboardPageLayout />,
    state: "mechanical-engineering",
    sidebarProps: {
      displayText: "Mechanical Engineering",
      icon: <DashboardOutlinedIcon />
    },
    child: [
      {
        path: "/mechanical-engineering/solidworks",
        element: <SolidWorksPage />,
        state: "solidworks",
        sidebarProps: {
          displayText: "SolidWorks"
        },
      }
    ]
  },
  {
    path: "/civil-engineering",
    element: <DashboardPageLayout />,
    state: "civil-engineering",
    sidebarProps: {
      displayText: "Civil Engineering",
      icon: <DashboardOutlinedIcon />
    },
    child: [
      {
        path: "/civil-engineering/solidworks",
        element: <SolidWorksPage />, // Assuming SolidWorks page can be shared
        state: "solidworks",
        sidebarProps: {
          displayText: "SolidWorks"
        },
      },
      {
        path: "/civil-engineering/autocad",
        element: <AutoCadPage />,
        state: "autocad",
        sidebarProps: {
          displayText: "AutoCad"
        },
      }
    ]
  }
];

export default appRoutes;
